import React, { useState, useContext } from 'react'

import { DataContext } from '../Context/DataContext'

const InputData = () => {

  const context = useContext(DataContext)

  const handleChange1 = (e) => {
    context.setData1(e.target.value)
    console.log(context.data1)
  }

  const handleChange2 = (e) => {
    context.setData2(e.target.value)
    console.log(context.data2)
  }

  const handleChange3 = (e) => {
    context.setData3(e.target.value)
    console.log(context.data3)
  }

  return (
    <div>
      <input name="data1" type="text" value={context.data1} onChange={handleChange1} />
      <input name="data2" type="text" value={context.data2} onChange={handleChange2} />
      <input name="data3" type="text" value={context.data3} onChange={handleChange3} />
    </div>
  )
}

export default InputData
